  return (
    <div className="jumbotron">
      <div className="header container">
        <h1 className="title">Lin Ping Chun</h1>
        <p className="subtitle">PROFILE / PROFLIO</p>
      </div>
      <div className="overlay"/>
    </div>
  );
}

export default Header;
